css:
@-moz-document domain("www.nitrotype.com") {
body
  {
    background-color: #2d2e2e;
    overflow-y: scroll;
    background: none;
    overflow-x: hidden;
    position: relative;
  }

  .card--grit
  {
    background-image: url("https://wallpapersite.com/images/wallpapers/red-2560x1600-curves-hd-10107.jpg");
    background: fixed;
  }

  html
  {
    background:  url("https://i.loli.net/2020/04/04/6Q37BSoMw9fa8bq.png") fixed repeat, #0ff0;
    box-sizing: border-box;
    color: #0ff0;
    font-family: "Montserrat", sans-serif;
    font-size: 16px;
    font-weight: 300;
    line-height: 1.6;
    background-size: 120%;
  }

  .bg--gradient
  {
    background: fixed;
  }

  .card--a
  {
    background-image: url("https://esportsobserver.com/wp-content/uploads/2018/05/FaZe-Clan-SteelSeries.jpg");
    color: #ADD8E6
;
    background-size: 0%;
  }

  .btn--primary
  {
    background: #000;
    text-shadow: 1px 1px 2px rgb(2, 2, 2);
    color: #ADD8E6
;
  }

  .theme--pDefault .profile-title
  {
    color: #ADD8E6
;
    text-shadow: 1px 1px 2px rgb(2, 2, 2);
  }

  .theme--pDefault .profile-levelNum
  {
    color: #ADD8E6
;
    text-shadow: 1px 1px 2px rgb(2, 2, 2);
  }

  .theme--pDefault .profile-body
  {
    color: #ADD8E6
;
          text-shadow: 1px 1px 1px rgb(2, 2, 2);
  }
}

@-moz-document domain("nitrotype.com") {
.dash-copyContainer
  {
    background: #1d1e2300;
    -webkit-box-shadow: 0px 1px 157px 10px rgba(255, 0, 0, .78);
    box-shadow: 0px 1px 157px 10px #8c93fb5e;
    border-radius: 5px;
    flex: 1;
    overflow: hidden;
    padding: 15px;
    display: flex;
  }

  .dash-copy
  {
    color: #8c93fb;
    font-family: "Roboto Mono", "Courier New", Courier, "Lucida Sans Typewriter", "Lucida Typewriter", monospace;
    font-size: 21.0px;
  }

  ::selection
  {
    background-color: #1976c6;
    color: white;
  }

  .bg--gradient
  {
    background: fixed;
  }

  .theme--pDefault .profile-bg
  {
    background: url("https://i.loli.net/2020/04/04/IludTbFfDx2ehtv.jpg") top left no-repeat, linear-gradient(0deg, #2d2e2e 100%, #ffffff 100%);
    color: #d3d3d3;
  }

  .btn--inky, .btn--inky:focus:not(:hover)
  {
    color: #ffffff;
  }

  .theme--pDefault .profile-bgHead
  {
    background: url("https://i.loli.net/2020/04/04/IludTbFfDx2ehtv.jpg") top left repeat, linear-gradient(0deg, #2d2e2e 10%, #ffffff 100%);
  }

  .theme--pDefault.is-gold .profile-bg
  {
    background: url("https://i.loli.net/2020/04/04/BEQJje5cbXmFvga.jpg") top left repeat, linear-gradient(0deg, #2d2e2e 10%, #ffffff 100%);
  }

  .theme--pDefault.is-guest .profile-bgHead
  {
    background: #2cff00;
  }
}
